best_answer_1:
b'<p>What you want to do is a combination of part of 1 and all of 2.</p>
<p>You need to use the PowerMockito.mockStatic to <strong>enable</strong> static mocking for all static methods of a class.  This means make it <strong>possible</strong> to stub them using the when-thenReturn syntax.</p>
<p>But the 2-argument overload of mockStatic you are using supplies a default strategy for what Mockito/PowerMock should do when you call a method you havent explicitly stubbed on the mock instance.</p>
<p>From the <a href=http://powermock.googlecode.com/svn/docs/powermock-1.4.12/apidocs/index.html rel=noreferrer>javadoc</a>:</p>
<blockquote>
<p>Creates class mock with a specified strategy for its answers to
  interactions. Its quite advanced feature and typically you dont need
  it to write decent tests. However it can be helpful when working with
  legacy systems. It is the default answer so it will be used only when
  you dont stub the method call.</p>
</blockquote>
<p>The <strong>default</strong> default stubbing strategy is to just return null, 0 or false for object, number and boolean valued methods.  By using the 2-arg overload, youre saying No, no, no, by default use this Answer subclass answer method to get a default value.  It returns a Long, so if you have static methods which return something incompatible with Long, there is a problem.</p>
<p>Instead, use the 1-arg version of mockStatic to enable stubbing of static methods, then use when-thenReturn to specify what to do for a particular method.  For example:</p>
<pre><code>import static org.mockito.Mockito.*;

import org.junit.Test;
import org.junit.runner.RunWith;
import org.mockito.invocation.InvocationOnMock;
import org.mockito.stubbing.Answer;
import org.powermock.api.mockito.PowerMockito;
import org.powermock.core.classloader.annotations.PrepareForTest;
import org.powermock.modules.junit4.PowerMockRunner;

class ClassWithStatics {
  public static String getString() {
    return String;
  }

  public static int getInt() {
    return 1;
  }
}

@RunWith(PowerMockRunner.class)
@PrepareForTest(ClassWithStatics.class)
public class StubJustOneStatic {
  @Test
  public void test() {
    PowerMockito.mockStatic(ClassWithStatics.class);

    when(ClassWithStatics.getString()).thenReturn(Hello!);

    System.out.println(String:  + ClassWithStatics.getString());
    System.out.println(Int:  + ClassWithStatics.getInt());
  }
}
</code></pre>
<p>The String-valued static method is stubbed to return Hello!, while the int-valued static method uses the default stubbing, returning 0.</p>'

b'<p>Following is a list of solutions to centering things in CSS horizontally. The snippet includes all of them.</p>
<p></p><div class=snippet data-babel=false data-console=true data-hide=true data-lang=js>
<div class=snippet-code snippet-currently-hidden>
<pre class=snippet-code-css lang-css prettyprint-override><code>html {
  font: 1.25em/1.5 Georgia, Times, serif;
}

pre {
  color: #fff;
  background-color: #333;
  padding: 10px;
}

blockquote {
  max-width: 400px;
  background-color: #e0f0d1;
}

blockquote &gt; p {
  font-style: italic;
}

blockquote &gt; p:first-of-type::before {
  content: open-quote;
}

blockquote &gt; p:last-of-type::after {
  content: close-quote;
}

blockquote &gt; footer::before {
  content: \2014;
}

.container,
blockquote {
  position: relative;
  padding: 20px;
}

.container {
  background-color: tomato;
}

.container::after,
blockquote::after {
  position: absolute;
  right: 0;
  bottom: 0;
  padding: 2px 10px;
  border: 1px dotted #000;
  background-color: #fff;
}

.container::after {
  content: .container- attr(data-num);
  z-index: 1;
}

blockquote::after {
  content: .quote- attr(data-num);
  z-index: 2;
}

.container-4 {
  margin-bottom: 200px;
}

/**
 * Solution 1
 */
.quote-1 {
  max-width: 400px;
  margin-right: auto;
  margin-left: auto;
}

/**
 * Solution 2
 */
.container-2 {
  text-align: center;
}

.quote-2 {
  display: inline-block;
  text-align: left;
}

/**
 * Solution 3
 */
.quote-3 {
  display: table;
  margin-right: auto;
  margin-left: auto;
}

/**
 * Solution 4
 */
.container-4 {
  position: relative;
}

.quote-4 {
  position: absolute;
  left: 50%;
  transform: translateX(-50%);
}

/**
 * Solution 5
 */
.container-5 {
  display: flex;
  justify-content: center;
}</code></pre>
<pre class=snippet-code-html lang-html prettyprint-override><code>&lt;main&gt;
  &lt;h1&gt;CSS: Horizontal Centering&lt;/h1&gt;

  &lt;h2&gt;Uncentered Example&lt;/h2&gt;
  &lt;p&gt;This is the scenario: We have a container with an element inside of it that we want to center. I just added a little padding and background colors so both elements are distinquishable.&lt;/p&gt;

  &lt;div class=container  container-0 data-num=0&gt;
    &lt;blockquote class=quote-0 data-num=0&gt;
      &lt;p&gt;My friend Data. You see things with the wonder of a child. And that makes you more human than any of us.&lt;/p&gt;
      &lt;footer&gt;Tasha Yar about Data&lt;/footer&gt;
    &lt;/blockquote&gt;
  &lt;/div&gt;

  &lt;h2&gt;Solution 1: Using &lt;code&gt;max-width&lt;/code&gt; &amp; &lt;code&gt;margin&lt;/code&gt; (IE7)&lt;/h2&gt;

  &lt;p&gt;This method is widely used. The upside here is that only the element which one wants to center needs rules.&lt;/p&gt;

&lt;pre&gt;&lt;code&gt;.quote-1 {
  max-width: 400px;
  margin-right: auto;
  margin-left: auto;
}&lt;/code&gt;&lt;/pre&gt;

  &lt;div class=container  container-1 data-num=1&gt;
    &lt;blockquote class=quote  quote-1 data-num=1&gt;
      &lt;p&gt;My friend Data. You see things with the wonder of a child. And that makes you more human than any of us.&lt;/p&gt;
      &lt;footer&gt;Tasha Yar about Data&lt;/footer&gt;
    &lt;/blockquote&gt;
  &lt;/div&gt;

  &lt;h2&gt;Solution 2: Using &lt;code&gt;display: inline-block&lt;/code&gt; and &lt;code&gt;text-align&lt;/code&gt; (IE8)&lt;/h2&gt;

  &lt;p&gt;This method utilizes that &lt;code&gt;inline-block&lt;/code&gt; elements are treated as text and as such they are affected by the &lt;code&gt;text-align&lt;/code&gt; property. This does not rely on a fixed width which is an upside. This is helpful for when you don\xc3\xa2\xe2\x82\xac\xe2\x84\xa2t know the number of elements in a container for example.&lt;/p&gt;

&lt;pre&gt;&lt;code&gt;.container-2 {
  text-align: center;
}

.quote-2 {
  display: inline-block;
  text-align: left;
}&lt;/code&gt;&lt;/pre&gt;

  &lt;div class=container  container-2 data-num=2&gt;
    &lt;blockquote class=quote  quote-2 data-num=2&gt;
      &lt;p&gt;My friend Data. You see things with the wonder of a child. And that makes you more human than any of us.&lt;/p&gt;
      &lt;footer&gt;Tasha Yar about Data&lt;/footer&gt;
    &lt;/blockquote&gt;
  &lt;/div&gt;

  &lt;h2&gt;Solution 3: Using &lt;code&gt;display: table&lt;/code&gt; and &lt;code&gt;margin&lt;/code&gt; (IE8)&lt;/h2&gt;

  &lt;p&gt;Very similar to the second solution but only requires to apply rules on the element that is to be centered.&lt;/p&gt;

&lt;pre&gt;&lt;code&gt;.quote-3 {
  display: table;
  margin-right: auto;
  margin-left: auto;
}&lt;/code&gt;&lt;/pre&gt;

  &lt;div class=container  container-3 data-num=3&gt;
    &lt;blockquote class=quote  quote-3 data-num=3&gt;
      &lt;p&gt;My friend Data. You see things with the wonder of a child. And that makes you more human than any of us.&lt;/p&gt;
      &lt;footer&gt;Tasha Yar about Data&lt;/footer&gt;
    &lt;/blockquote&gt;
  &lt;/div&gt;

  &lt;h2&gt;Solution 4: Using &lt;code&gt;translate()&lt;/code&gt; and &lt;code&gt;position&lt;/code&gt; (IE9)&lt;/h2&gt;

  &lt;p&gt;Don\xc3\xa2\xe2\x82\xac\xe2\x84\xa2t use as a general approach for horizontal centering elements. The downside here is that the centered element will be removed from the document flow. Notice the container shrinking to zero height with only the padding keeping it visible. This is what &lt;i&gt;removing an element from the document flow&lt;/i&gt; means.&lt;/p&gt;

  &lt;p&gt;There are however applications for this technique. For example, it works for &lt;b&gt;vertically&lt;/b&gt; centering by using &lt;code&gt;top&lt;/code&gt; or &lt;code&gt;bottom&lt;/code&gt; together with &lt;code&gt;translateY()&lt;/code&gt;.&lt;/p&gt;

&lt;pre&gt;&lt;code&gt;.container-4 {
    position: relative;
}

.quote-4 {
  position: absolute;
  left: 50%;
  transform: translateX(-50%);
}&lt;/code&gt;&lt;/pre&gt;

  &lt;div class=container  container-4 data-num=4&gt;
    &lt;blockquote class=quote  quote-4 data-num=4&gt;
      &lt;p&gt;My friend Data. You see things with the wonder of a child. And that makes you more human than any of us.&lt;/p&gt;
      &lt;footer&gt;Tasha Yar about Data&lt;/footer&gt;
    &lt;/blockquote&gt;
  &lt;/div&gt;

  &lt;h2&gt;Solution 5: Using Flexible Box Layout Module (IE10+ with vendor prefix)&lt;/h2&gt;

  &lt;p&gt;&lt;/p&gt;

&lt;pre&gt;&lt;code&gt;.container-5 {
  display: flex;
  justify-content: center;
}&lt;/code&gt;&lt;/pre&gt;

  &lt;div class=container  container-5 data-num=5&gt;
    &lt;blockquote class=quote  quote-5 data-num=5&gt;
      &lt;p&gt;My friend Data. You see things with the wonder of a child. And that makes you more human than any of us.&lt;/p&gt;
      &lt;footer&gt;Tasha Yar about Data&lt;/footer&gt;
    &lt;/blockquote&gt;
  &lt;/div&gt;
&lt;/main&gt;</code></pre>
</div>
</div>
<hr/>
<h2><code>display: flex</code></h2>
<pre><code>.container {
  display: flex;
  justify-content: center;
}
</code></pre>
<p><strong>Notes</strong>:</p>
<ul>
<li></li></ul>'

