b'<p>You have two problems.</p>
<p>First, the prop you pass to <code>RenderPhotos</code> is <code>this.props.photos</code>, which is undefined in <code>AwesomeProject</code>. Looking in the <code>render()</code> function of <code>RenderPhotos</code>, you try to access the element at index 0 of <code>this.props.photos</code>, which is undefined. Thats probably whats causing your error. I suspect you meant to set the photos prop equal to <code>this.state.photos</code> in the <code>render()</code> function of the <code>AwesomeProject</code> component.</p>
<p>Second, inside <code>componentWillMount()</code> of the <code>AwesomeProject</code> component, you make two state changes after you get photos from the API:</p>
<pre><code>this.setState({
  isLoading: false
});

this.setState({
  photos: JSON.stringify(responseData)
});
</code></pre>
<p>Its possible, but not guaranteed, that React might batch those two <code>setState()</code> calls, so both state properties would be set at the same time and the <code>render()</code> method would be called only once. However, if these <code>setState()</code> functions are executed synchronously, the <code>render()</code> function will be called while <code>this.state.loading === false</code> and <code>this.state.photos === undefined</code>. The <code>RenderPhotos</code> component will mount and receive the prop <code>photos={this.state.photos}</code> (after making the change I described above). Unfortunately, because <code>this.state.photos</code> is undefined, you will encounter the same problem as above when you try to access <code>this.props.photos[0]</code> inside the <code>render()</code> function of <code>RenderPhotos</code>. Heres my suggestion to fix your problem:</p>
<pre><code>var AwesomeProject = React.createClass({
    getInitialState: function() {
      return {
        isLoading: true,
        photos: this.props.photos
      };
    },
    componentWillMount: function(){
      fetch(http://localhost:3000/api/photos/, {
          method: GET, 
          headers: {
            x-access-token:xxxxx,
            x-key:xxxx
          },
        })
        .then((response) =&gt; response.json())
        .then((responseData) =&gt; {
            AlertIOS.alert(
                GET Response,
                Search Query -&gt;  + JSON.stringify(responseData)
            )
            // Set both state properties at the same time to avoid passing an undefined value as a prop to RenderPhotos
            this.setState({
              isLoading: false,
              photos: JSON.stringify(responseData)
            });
        })
        .done();
    },
    render: function() {
        if(this.state.isLoading){
          return &lt;View&gt;&lt;Text&gt;Loading...&lt;/Text&gt;&lt;/View&gt;
       }
       // RenderPhotos should receive this.state.photos as a prop, not this.props.photos
        return (
            &lt;RenderPhotos photos={this.state.photos}/&gt;
        );
    },

});

var RenderPhotos = React.createClass({
  getInitialState: function() {
      return {
        photos: this.props.photos
      };
  },
  render: function(){
    var photos = Photos;
    return (
      &lt;View&gt;
        &lt;Text&gt; {this.props.photos[0]} &lt;/Text&gt;
      &lt;/View&gt;
    )
  }
});
</code></pre>'

