b'<p>If your onclick function returns false the default browser behaviour is cancelled. As such:</p>
<pre><code>&lt;a href=http://www.google.com onclick=return check()&gt;check&lt;/a&gt;

&lt;script type=text/javascript&gt;

function check()
{
    return false;
}

&lt;/script&gt;
</code></pre>
<p>Either way, whether google does it or not isnt of much importance. Its cleaner to bind your onclick functions within javascript - this way you separate your HTML from other code.</p>'

b'<p>It always depends on your filesystem and how it is set up.</p>
<p>The short answer is that <code>allFile</code> retrieves all kind of files (images, markdowns, JSONs, etc) set in your <code>gatsby-source-filesystem</code> while <code>allMarkdownRemark</code> only fetches the markdown files because a transformer plugin has previously created a specific node to do so.</p>
<p><code>allMarkdownRemark</code>, of course, is more specific and has better performance, since you are querying only markdown files, not all kinds of files like <code>allFile</code> does. Regarding the filters, both are available (relative and absolute paths), use the GraphQL playground (<code>localhost:8000/___graphql</code>) to test them.</p>
<hr/>
<h2>TL;DR</h2>
<p><a href=https://www.gatsbyjs.com/plugins/gatsby-source-filesystem/ rel=nofollow noreferrer><code>gatsby-source-filesystem</code></a> creates file nodes from files. The various transformer plugins can transform file nodes into various other types of data e.g. <code>gatsby-transformer-json</code> transforms JSON files into JSON data nodes and <code>gatsby-transformer-remark</code> transforms markdown files into <code>MarkdownRemark</code> nodes from which you can query an HTML representation of the markdown.</p>
<p>Summarizing, <code>gatsby-source-filesystem</code> retrieves all types of files but must be set for each data folder to help other plugins to transform the file type into nodes to make them available to Gatsby and GraphQL.</p>
<p><code>allMarkdownRemark</code>, is another transformer plugin that turns all markdown files (previously set in the <code>gatsby-source-filesystem</code>) into GraphQL nodes to make them available when you query a markdown file, allowing you to retrieve specific data from it.</p>
<p>Lets assume a filesystem like:</p>
<pre><code>{
  resolve: `gatsby-source-filesystem`,
  options: {
    name: `images`,
    path: `${__dirname}/src/images/`,
  },
},

{
  resolve: `gatsby-source-filesystem`,
  options: {
    name: `jsons`,
    path: `${__dirname}/src/jsons/`,
  },
},
{
  resolve: `gatsby-source-filesystem`,
  options: {
    name: `markdowns`,
    path: `${__dirname}/src/markdowns/`,
  },
},
</code></pre>
<p>If you leave the filesystem like this, <code>allFile</code> will retrieve JSONs as well as images and markdowns but you wont be able to query specific data from them, because theres no transformer plugin that has created a node, in addition, you will lose all the benefits of using combined plugins. If you add the <code>gatsby-transformer-remark</code> with the previous filesystem configuration like:</p>
<pre><code>{
  resolve: `gatsby-transformer-remark`,
  options: {
    plugins: [
      {
        resolve: `gatsby-remark-relative-images`,
      },
      {
        resolve: `gatsby-remark-images`,
        options: {
          maxWidth: 1200,
          withWebp: true,
        },
      },
    ],
  },
},
</code></pre>
<p>You are creating nodes for all markdown files and creating relative paths for images in there (<code>gatsby-remark-relative-images</code>), what saves you a few headaches and parses the images from it.</p>'

