<pre><code>FILE *in = fopen(./task.in, r);
int length = 0;
int counter;
int sequence;

for ( int i = 0; i &lt; 10; i++ ) {
    counter = fscanf(in, %d, &amp;sequence);
    if ( counter == 1 ) {
        length += 1;
    }
}
</code></pre>
<p>To find out the end of the file with symbols you can use EOF. For example:</p>
<pre><code>char symbol;
FILE *in = fopen(./task.in, r);

