b'<p>Your form is being submitted already as your button is type <code>submit</code>.  Which in most browsers would result in a form submission and loading of the server response rather than executing javascript on the page.</p>
<p>Change the type of the submit button to a <code>button</code>.  Also, as this button is given the id <code>submit</code>, it will cause a conflict with Javascripts submit function.  Change the id of this button.  Try something like</p>
<pre><code>&lt;input type=button value=Submit id=btnsubmit onclick=submitForm()&gt;
</code></pre>
<p>Another issue in this instance is that the name of the form contains a <code>-</code> dash.  However, Javascript translates <code>-</code> as a minus.</p>
<p>You will need to either use array based notation or use <code>document.getElementById()</code> / <code>document.getElementsByName()</code>. The <code>getElementById()</code> function returns the element instance directly as Id is unique (but it requires an Id to be set).  The <code>getElementsByName()</code> returns an array of values that have the same name.  In this instance as we have not set an id, we can use the <code>getElementsByName</code> with index 0.</p>
<p>Try the following</p>
<pre><code>function submitForm() {
   // Get the first form with the name
   // Usually the form name is not repeated
   // but duplicate names are possible in HTML
   // Therefore to work around the issue, enforce the correct index
   var frm = document.getElementsByName(contact-form)[0];
   frm.submit(); // Submit the form
   frm.reset();  // Reset all form data
   return false; // Prevent page refresh
}
</code></pre>'

